//SPDX-License-Identifier: GPL-3.0
 
pragma solidity >=0.5.0 <0.9.0;

// Creating an abstract contract
abstract contract abstractContract {
  
    // Declaring functions
    function getStr(string memory _strIn) public view virtual returns(string memory);

    function setValue(uint _in1, uint _in2) public virtual;

    function add() public virtual returns(uint);
}

contract newContract is abstractContract{

    // Declaring private 
    // variables
    uint private num1;
    uint private num2;
  
    // Defining functions inherited 
    // from abstract parent contract
    function getStr(string memory _strIn) public override view returns(string memory){
        return _strIn;
    }
      
    function setValue(uint _in1, uint _in2) public override {
        num1 = _in1;
        num2 = _in2;
    }
    function add() public view override returns(uint){
        return (num2 + num1);
    }
}

